%[text] # Tree Carbon Intake Modeling
%[text] ## Model Parameters
mtype = "robust" ;% Model type %[control:dropdown:316e]{"position":[9,17]}
Nt = 1000;% Number of trees in a patch %[control:slider:9981]{"position":[6,10]}
r =0.5;% Mean growth rate %[control:slider:8552]{"position":[4,7]}
TB = 0.002;% Total biomass of 1 tree %[control:slider:9c5a]{"position":[6,11]}
WP = 0.3;% Percentage of water in total tree biomass %[control:slider:7599]{"position":[6,9]}
CP =0.5;% Percentage of carbon in dry biomass %[control:slider:45ed]{"position":[5,8]}
t = 84;% Number of years %[control:slider:620f]{"position":[5,7]}
%########################################################################%
std = 0.1;% Standard Deviation for stochastic  %[control:slider:4c54]{"position":[7,10]}
% growth model
%########################################################################%
maxr =0.67;% Max growth rate for growth feedback %[control:slider:8dee]{"position":[7,11]}
maxbio = 0.075;% Max biomass for growth feedback %[control:slider:61a1]{"position":[10,15]}
%########################################################################%
target = 10;% Carbon target for harvest rule model %[control:slider:7326]{"position":[10,12]}
%########################################################################%
site = "good" ;% Site condition for site class model %[control:dropdown:8707]{"position":[8,14]}
%Site class variables
good_maxr = 0.74;% good site max growth rate %[control:slider:230c]{"position":[13,17]}
good_maxbio = 0.083;% good site max biomass per tree %[control:slider:6121]{"position":[15,20]}
good_sd = 0.11;% good site standard dev %[control:slider:93e9]{"position":[11,15]}
mod_maxr = 0.67;% mod site max growth rate %[control:slider:48c9]{"position":[12,16]}
mod_maxbio = 0.075;% mod site max biomass per tree %[control:slider:285f]{"position":[14,19]}
mod_sd = 0.1;% mod site max growth rate %[control:slider:14c8]{"position":[10,13]}
poor_maxr = 0.6;% poor site max growth rate %[control:slider:3d08]{"position":[13,16]}
poor_maxbio = 0.067;% poor site max biomass per tree %[control:slider:21a0]{"position":[15,20]}
poor_sd = 0.09;% poor site max growth rate %[control:slider:4685]{"position":[11,15]}
%########################################################################%
percent = 50;% percentile for percentile yield model %[control:slider:5c28]{"position":[11,13]}
%[text] ## Variables
DB = TB-(TB*WP);% Dry Biomass of a tree
C = DB*CP; % Total Carbon in a tree
%disp("Total carbon in a tree is "+C)
CpP = C*Nt;
%disp("Carbon per patch in a year is "+CpP)
Total_biomass = TB*Nt;
Dry_biomass = DB*Nt;

%Make the "storage variables"
generation = linspace(0,t,t+1);
growth = zeros(size(generation));
carbon = zeros(size(generation));
biomass = zeros(size(generation));
drybio = zeros(size(generation));
harvested = zeros(size(generation));
rank = zeros(1,100);
% Assuming size(generation) returns [m, n]
[m, n] = size(generation);
% Create a 3D matrix with the third dimension being 1 initially
percentile_data = zeros(7, n, 1);
% Add the new "slice" along the third dimension
new_slices = zeros(7, n, 99);
% Concatenate along the third dimension
percentile_data = cat(3, percentile_data, new_slices);
robustclass = zeros(100,n);
%[text] ## Run Model
%"If" statement selects appropriate model
if mtype == "constant"   %run the constant growth model
    for i = 1:size(generation,2)    
        if i == 1   %The generation has population = N0
            carbon(i) = CpP;
            growth(i) = 0;
            biomass(i) = Total_biomass;
            drybio(i) = Dry_biomass;
        else
            growth(i) = r;
            carbon(i) = carbon(i-1)+(carbon(i-1)*growth(i)); %At the new
            %timestep, the population has grown by dNdt from the previous
            %generation
            biomass(i) = biomass(i-1)+(biomass(i-1)*growth(i));
            drybio(i) = drybio(i-1)+(drybio(i-1)*growth(i));
        end
    end
    
elseif mtype == "stochastic"   %run the stochastic growth model
    for i = 1:size(generation,2)
        if i == 1
            growth(i) = 0;
            carbon(i) = CpP;
            biomass(i) = Total_biomass;
            drybio(i) = Dry_biomass;
        else
            growth(i) = [norminv(rand(),r,std)];
            carbon(i) = carbon(i-1)+(carbon(i-1)*growth(i));
            biomass(i) = biomass(i-1)+(biomass(i-1)*growth(i));
            drybio(i) = drybio(i-1)+(drybio(i-1)*growth(i));
        end
    end
elseif mtype == "feedback"   %run the growth feed back model
    for i = 1:size(generation,2)
        if i == 1
            carbon(i) = CpP;
            biomass(i) = Total_biomass;
            growth(i) = 0;
            drybio(i) = Dry_biomass;
        else
            growth(i) = (maxr*((maxbio-(biomass(i-1)/Nt))/maxbio));
            carbon(i) = carbon(i-1)+(carbon(i-1)*growth(i));
            biomass(i) = biomass(i-1)+(biomass(i-1)*growth(i));
            drybio(i) = drybio(i-1)+(drybio(i-1)*growth(i));
        end
    end
elseif mtype == "stofeed"   %run the stochastic + feedback model
    for i = 1:size(generation,2)
        if i == 1
            carbon(i) = CpP;
            biomass(i) = Total_biomass;
            growth(i) = 0;
            drybio(i) = Dry_biomass;
        else
            for m = 1:10
            random_value = norminv(rand(), r, std);
                while random_value >= maxr 
                random_value = norminv(rand(), r, std);
                end
                growth(i) = random_value*((maxbio-(biomass(i-1)/Nt))/maxbio);
            end
            carbon(i) = carbon(i-1)+(carbon(i-1)*growth(i));
            biomass(i) = biomass(i-1)+(biomass(i-1)*growth(i));
            drybio(i) = drybio(i-1)+(drybio(i-1)*growth(i));
        end
    end
elseif mtype == "harvest"   %run the harvest rule model
    for i = 1:size(generation,2)
        if i == 1
            carbon(i) = CpP;
            biomass(i) = Total_biomass;
            growth(i) = 0;
            drybio(i) = Dry_biomass;
        elseif i > 1 & carbon(i-1) <= target
            for m = 1:10
            random_value = norminv(rand(), r, std);
                while random_value >= maxr 
                random_value = norminv(rand(), r, std);
                end
                growth(i) = random_value*((maxbio-(biomass(i-1)/Nt))/maxbio);
            end
            carbon(i) = carbon(i-1)+(carbon(i-1)*growth(i));
            biomass(i) = biomass(i-1)+(biomass(i-1)*growth(i));
            drybio(i) = drybio(i-1)+(drybio(i-1)*growth(i));
            harvested(i) = harvested(i-1);
        else
            for m = 1:10
            random_value = norminv(rand(), r, std);
                while random_value >= maxr 
                random_value = norminv(rand(), r, std);
                end
                growth(i) = random_value*((maxbio-(biomass(i-1)/Nt))/maxbio);
            end
            carbon(i) = CpP+(CpP*growth(i));
            biomass(i) = Total_biomass+(Total_biomass*growth(i));
            drybio(i) = Dry_biomass+(Dry_biomass*growth(i));
            harvested(i) = harvested(i-1)+carbon(i-1);
        end
    end
elseif mtype == "siterule"   %run the site class rule model
    if site == "good"
        for i = 1:size(generation,2)
            if i == 1
                carbon(i) = CpP;
                biomass(i) = Total_biomass;
                growth(i) = 0;
                drybio(i) = Dry_biomass;
            elseif i > 1 && carbon(i-1) <= target
                for m = 1:10
                random_value = norminv(rand(), r, good_sd);
                    while random_value >= good_maxr 
                    random_value = norminv(rand(), r, good_sd);
                    end
                    growth(i) = random_value*((good_maxbio-(biomass(i-1)/Nt))/good_maxbio);
                end
                carbon(i) = carbon(i-1)+(carbon(i-1)*growth(i));
                biomass(i) = biomass(i-1)+(biomass(i-1)*growth(i));
                drybio(i) = drybio(i-1)+(drybio(i-1)*growth(i));
                harvested(i) = harvested(i-1);
            else
                for m = 1:10
                random_value = norminv(rand(), r, good_sd);
                    while random_value >= good_maxr 
                    random_value = norminv(rand(), r, good_sd);
                    end
                    growth(i) = random_value*((good_maxbio-(biomass(i-1)/Nt))/good_maxbio);
                end
                carbon(i) = CpP+(CpP*growth(i));
                biomass(i) = Total_biomass+(Total_biomass*growth(i));
                drybio(i) = Dry_biomass+(Dry_biomass*growth(i));
                harvested(i) = harvested(i-1)+carbon(i-1);
            end
        end
    elseif site == "mod"
        for i = 1:size(generation,2)
            if i == 1
                carbon(i) = CpP;
                biomass(i) = Total_biomass;
                growth(i) = 0;
                drybio(i) = Dry_biomass;
            elseif i > 1 && carbon(i-1) <= target
                for m = 1:10
                random_value = norminv(rand(), r, mod_sd);
                    while random_value >= mod_maxr 
                    random_value = norminv(rand(), r, mod_sd);
                    end
                    growth(i) = random_value*((mod_maxbio-(biomass(i-1)/Nt))/mod_maxbio);
                end
                carbon(i) = carbon(i-1)+(carbon(i-1)*growth(i));
                biomass(i) = biomass(i-1)+(biomass(i-1)*growth(i));
                drybio(i) = drybio(i-1)+(drybio(i-1)*growth(i));
                harvested(i) = harvested(i-1);
            else
                for m = 1:10
                random_value = norminv(rand(), r, mod_sd);
                    while random_value >= mod_maxr 
                    random_value = norminv(rand(), r, mod_sd);
                    end
                    growth(i) = random_value*((mod_maxbio-(biomass(i-1)/Nt))/mod_maxbio);
                end
                carbon(i) = CpP+(CpP*growth(i));
                biomass(i) = Total_biomass+(Total_biomass*growth(i));
                drybio(i) = Dry_biomass+(Dry_biomass*growth(i));
                harvested(i) = harvested(i-1)+carbon(i-1);
            end
        end
    elseif site == "poor"
        for i = 1:size(generation,2)
            if i == 1
                carbon(i) = CpP;
                biomass(i) = Total_biomass;
                growth(i) = 0;
                drybio(i) = Dry_biomass;
            elseif i > 1 & carbon(i-1) <= target
                for m = 1:10
                random_value = norminv(rand(), r, poor_sd);
                    while random_value >= poor_maxr 
                    random_value = norminv(rand(), r, poor_sd);
                    end
                    growth(i) = random_value*((poor_maxbio-(biomass(i-1)/Nt))/poor_maxbio);
                end
                carbon(i) = carbon(i-1)+(carbon(i-1)*growth(i));
                biomass(i) = biomass(i-1)+(biomass(i-1)*growth(i));
                drybio(i) = drybio(i-1)+(drybio(i-1)*growth(i));
                harvested(i) = harvested(i-1);
            else
                for m = 1:10
                random_value = norminv(rand(), r, poor_sd);
                    while random_value >= poor_maxr 
                    random_value = norminv(rand(), r, poor_sd);
                    end
                    growth(i) = random_value*((poor_maxbio-(biomass(i-1)/Nt))/poor_maxbio);
                end
                carbon(i) = CpP+(CpP*growth(i));
                biomass(i) = Total_biomass+(Total_biomass*growth(i));
                drybio(i) = Dry_biomass+(Dry_biomass*growth(i));
                harvested(i) = harvested(i-1)+carbon(i-1);
            end
        end
    end
elseif mtype == "percentile"   %run the percentile rule model
    for n = 1:size(rank,2)
        for i = 1:size(generation,2)
            if i == 1
                carbon(i) = CpP;
                biomass(i) = Total_biomass;
                growth(i) = 0;
                drybio(i) = Dry_biomass;
            elseif i > 1 & carbon(i-1) <= target
                for m = 1:10
                random_value = norminv(rand(), r, std);
                    while random_value >= maxr 
                    random_value = norminv(rand(), r, std);
                    end
                    growth(i) = random_value*((maxbio-(biomass(i-1)/Nt))/maxbio);
                end
                carbon(i) = carbon(i-1)+(carbon(i-1)*growth(i));
                biomass(i) = biomass(i-1)+(biomass(i-1)*growth(i));
                drybio(i) = drybio(i-1)+(drybio(i-1)*growth(i));
                harvested(i) = harvested(i-1);
            else
                for m = 1:10
                random_value = norminv(rand(), r, std);
                    while random_value >= maxr 
                    random_value = norminv(rand(), r, std);
                    end
                    growth(i) = random_value*((maxbio-(biomass(i-1)/Nt))/maxbio);
                end
                carbon(i) = CpP+(CpP*growth(i));
                biomass(i) = Total_biomass+(Total_biomass*growth(i));
                drybio(i) = Dry_biomass+(Dry_biomass*growth(i));
                harvested(i) = harvested(i-1)+carbon(i-1);
            end
        end
        percentile_data(1,:,n) = generation;
        percentile_data(2,:,n) = carbon;
        percentile_data(3,:,n) = growth;
        percentile_data(4,:,n) = biomass;
        percentile_data(5,:,n) = drybio;
        percentile_data(6,:,n) = harvested;
        rank(n) = harvested(1,end);
        percentile_data(7,:,n) = rank(n);
    end
    rank = sort(rank);
    wanted_harvested = rank(:,percent);
    for i = 1:100
        if percentile_data(7,1,i) == wanted_harvested
            carbon = percentile_data(2,:,i);
            growth = percentile_data(3,:,i);
            biomass = percentile_data(4,:,i);
            drybio = percentile_data(5,:,i);
            harvested = percentile_data(6,:,i);
        end
    end
elseif mtype == "robust"   %run the robust site rule model
    for n = 1:size(rank,2)
        for i = 1:size(generation,2)
            if i == 1
                carbon(i) = CpP;
                biomass(i) = Total_biomass;
                growth(i) = 0;
                drybio(i) = Dry_biomass;
            elseif i > 1 && carbon(i-1) <= target
                for m = 1:10
                random_value = norminv(rand(), r, std);
                    while random_value >= maxr 
                    random_value = norminv(rand(), r, std);
                    end
                    growth(i) = random_value*((maxbio-(biomass(i-1)/Nt))/maxbio);
                end
                carbon(i) = carbon(i-1)+(carbon(i-1)*growth(i));
                biomass(i) = biomass(i-1)+(biomass(i-1)*growth(i));
                drybio(i) = drybio(i-1)+(drybio(i-1)*growth(i));
                harvested(i) = harvested(i-1);
            else
                for m = 1:10
                random_value = norminv(rand(), r, std);
                    while random_value >= maxr 
                    random_value = norminv(rand(), r, std);
                    end
                    growth(i) = random_value*((maxbio-(biomass(i-1)/Nt))/maxbio);
                end
                carbon(i) = CpP+(CpP*growth(i));
                biomass(i) = Total_biomass+(Total_biomass*growth(i));
                drybio(i) = Dry_biomass+(Dry_biomass*growth(i));
                harvested(i) = harvested(i-1)+carbon(i-1);
            end
        end
        percentile_data(1,:,n) = generation;
        percentile_data(2,:,n) = carbon;
        percentile_data(3,:,n) = growth;
        percentile_data(4,:,n) = biomass;
        percentile_data(5,:,n) = drybio;
        percentile_data(6,:,n) = harvested;
        rank(n) = harvested(1,end);
        percentile_data(7,:,n) = rank(n);
    end
    rank = sort(rank);
    wanted_harvested = rank(:,percent);
    for i = 1:100
        if percentile_data(7,1,i) == wanted_harvested
            carbon = percentile_data(2,:,i);
            growth = percentile_data(3,:,i);
            biomass = percentile_data(4,:,i);
            drybio = percentile_data(5,:,i);
            harvested = percentile_data(6,:,i);
        end
        for n = 1:size(generation,2)
            for z = 1:size(generation,2)
                if percentile_data(6,n,i) > target
                    robustclass(i,n) = 1;
                    if z > 1 && robustclass(i,z) == robustclass(i,z-1)
                        robustclass(i,z) = 0;
                    end
                end
            end
        end
    end
    %robustsite = table(generation', carbon', growth', biomass', drybio', ...
    %'VariableNames', {'Year', 'Carbon', 'Yearly growth rate', 'Total Biomass', ...
    %['Dry Biomass']});
end
%[text] ## Visualize result
% Create a table
Carbon_T = table(generation', carbon', growth', biomass', drybio', ...
    'VariableNames', {'Year', 'Carbon', 'Yearly growth rate', 'Total Biomass', ...
    ['Dry Biomass']});
if mtype == "harvest" | mtype == "siterule" | mtype == "percentile" | mtype == "robust"
    Carbon_T = addvars(Carbon_T, harvested', 'NewVariableNames', 'Harvested Carbon');
end


% Display the table
disp(Carbon_T); %[output:2afe62aa]
%disp(robustsite)

%Make a plot to look at your results
figure('Position',[50 50 400 800]); %[output:8f97abe6]
tiledlayout(5,2,'Padding','tight') %[output:8f97abe6]

nexttile %[output:8f97abe6]
plot(generation,carbon,'LineWidth',1.5) %[output:8f97abe6]
xlabel('Year') %[output:8f97abe6]
ylabel('Carbon') %[output:8f97abe6]
title('Carbon over time') %[output:8f97abe6]
xlim([min(generation) max(generation)]) %[output:8f97abe6]

if mtype == "percentile" | mtype == "robust"
    nexttile %[output:8f97abe6]
    perc = linspace(1,100,100);
    plot(rank,perc,'LineWidth',1.5) %[output:8f97abe6]
    xlabel('Carbon yield') %[output:8f97abe6]
    ylabel('Percentile') %[output:8f97abe6]
    title('Distribution of 100 runs for carbon yield') %[output:8f97abe6]
end

nexttile %[output:8f97abe6]
plot(generation,biomass,'LineWidth',1.5) %[output:8f97abe6]
xlabel('Year') %[output:8f97abe6]
ylabel('Biomass') %[output:8f97abe6]
title('Biomass over time') %[output:8f97abe6]
xlim([min(generation) max(generation)]) %[output:8f97abe6]

if mtype == "harvest" | mtype == "siterule" | mtype == "percentile" | mtype == "robust"
    nexttile %[output:8f97abe6]
    plot(generation,harvested,'LineWidth',1.5) %[output:8f97abe6]
    xlabel('Year') %[output:8f97abe6]
    ylabel('Harvested carbon') %[output:8f97abe6]
    title('Harvested Carbon over time') %[output:8f97abe6]
    xlim([min(generation) max(generation)]) %[output:8f97abe6]
end

nexttile %[output:8f97abe6]
plot(generation,growth,'LineWidth',1.5)  %[output:8f97abe6]
xlabel('Year') %[output:8f97abe6]
ylabel('Growth') %[output:8f97abe6]
title('Yearly growth rate') %[output:8f97abe6]
xlim([min(generation) max(generation)]) %[output:8f97abe6]

nexttile %[output:8f97abe6]
plot(carbon,growth,'LineWidth',1.5)  %[output:8f97abe6]
xlabel('Carbon') %[output:8f97abe6]
ylabel('Growth rate') %[output:8f97abe6]
title('Growth rate vs. Carbon') %[output:8f97abe6]
xlim([min(carbon) max(carbon)]) %[output:8f97abe6]

nexttile %[output:8f97abe6]
plot(carbon,biomass,'LineWidth',1.5)  %[output:8f97abe6]
xlabel('Carbon') %[output:8f97abe6]
ylabel('Biomass') %[output:8f97abe6]
title('Biomass vs. Carbon') %[output:8f97abe6]
xlim([min(carbon) max(carbon)]) %[output:8f97abe6]

